    primes_less_than_10 = [2, 3, 5, 7]
    check_zero = str(lst).count('-0')
    for num in lst:
        num = round(abs(num)) if abs(num) % 1 >= 0.5 else int(abs(num))
        if num != 0 and all((num % i != 1 for i in primes_less_than_10)):
            product *= num
    for i in range(check_zero):
        product *= -1
    return product

